<!DOCTYPE html>
<html lang="pt-BR">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Sorteios da Loteria Quina</title>
    <link href="https://fonts.googleapis.com/css2?family=Poppins:wght@300;400;600;700&display=swap" rel="stylesheet">
    <style>
        /* CSS INTEGRADO - Tema Roxo e Responsivo */
        :root {
            --primary-color: #6A1B9A; /* Roxo escuro principal para títulos e dezenas */
            --secondary-color: #4A148C; /* Roxo mais escuro para botões e destaques */
            --accent-color: #FFC107; /* Amarelo para detalhes (mantido para contraste) */
            --text-color: #333;
            --light-bg: #fcfcfc; /* Fundo mais claro para os cards */
            --dark-bg: #f3e5f5; /* Fundo ligeiramente mais claro e roxeado para os cards de sorteio */
            --border-color: #e0b0e6; /* Borda em tom de roxo claro */
            --shadow-light: 0 4px 12px rgba(0, 0, 0, 0.08);
            --shadow-medium: 0 8px 20px rgba(0, 0, 0, 0.12);
            --border-radius-sm: 10px;
            --border-radius-md: 20px;
        }

        body {
            font-family: 'Poppins', sans-serif;
            background: linear-gradient(135deg, #e3d0ec, #f8f0fa); /* Gradiente roxo suave */
            color: var(--text-color);
            margin: 0;
            padding: 20px;
            display: flex;
            justify-content: center;
            align-items: flex-start;
            min-height: 100vh;
            box-sizing: border-box;
            overflow-x: hidden; /* Evita rolagem horizontal em mobile */
        }

        .container {
            background-color: #ffffff;
            padding: 40px;
            border-radius: var(--border-radius-md);
            box-shadow: var(--shadow-medium);
            width: 100%;
            max-width: 950px; /* Aumenta um pouco mais a largura máxima */
            box-sizing: border-box;
            animation: fadeIn 0.8s ease-out forwards; /* Animação de entrada */
        }

        @keyframes fadeIn {
            from { opacity: 0; transform: translateY(30px); }
            to { opacity: 1; transform: translateY(0); }
        }

        h1 {
            color: var(--primary-color);
            text-align: center;
            margin-bottom: 40px; /* Mais espaço abaixo do título */
            font-weight: 700;
            font-size: 2.8em; /* Título maior */
            letter-spacing: -0.8px;
            text-shadow: 1px 2px 4px rgba(0, 0, 0, 0.08); /* Sombra mais suave */
        }

        .section-card {
            background-color: var(--light-bg);
            padding: 30px; /* Mais padding interno */
            border-radius: var(--border-radius-sm);
            border: 1px solid var(--border-color);
            margin-bottom: 30px; /* Mais espaço entre os cards */
            box-shadow: 0 4px 15px rgba(0, 0, 0, 0.08); /* Sombra mais pronunciada */
        }

        .search-bar, .add-concurso-section {
            display: flex;
            flex-wrap: wrap;
            gap: 15px; /* Mais espaçamento entre os itens */
            align-items: center;
        }

        .search-bar label, .add-concurso-section label {
            font-weight: 600;
            color: var(--primary-color);
            flex-basis: 100%;
            margin-bottom: 8px; /* Mais espaço abaixo do label */
            font-size: 1.15em; /* Fonte ligeiramente maior */
        }

        .search-bar input[type="number"],
        .add-concurso-section input[type="text"] {
            flex-grow: 1;
            padding: 14px 18px; /* Mais padding */
            border: 2px solid var(--border-color);
            border-radius: var(--border-radius-sm);
            font-size: 1.05em; /* Fonte ligeiramente maior */
            min-width: 200px; /* Aumenta largura mínima */
            transition: border-color 0.3s ease, box-shadow 0.3s ease;
            outline: none;
        }

        .search-bar input[type="number"]:focus,
        .add-concurso-section input[type="text"]:focus {
            border-color: var(--secondary-color); /* Borda roxa ao focar */
            box-shadow: 0 0 0 4px rgba(74, 20, 140, 0.25); /* Sombra roxa ao focar */
        }

        .search-bar button, .add-concurso-section button {
            padding: 14px 22px; /* Mais padding */
            border: none;
            border-radius: var(--border-radius-sm);
            cursor: pointer;
            font-size: 1.05em; /* Fonte ligeiramente maior */
            font-weight: 600;
            color: white;
            transition: background-color 0.3s ease, transform 0.2s ease, box-shadow 0.3s ease;
            box-shadow: var(--shadow-light);
        }

        #searchButton {
            background-color: var(--secondary-color);
        }
        #searchButton:hover {
            background-color: #311B92; /* Roxo mais escuro */
            transform: translateY(-3px); /* Mais deslocamento no hover */
            box-shadow: var(--shadow-medium);
        }

        #clearSearch {
            background-color: #757575; /* Cinza (mantido para contraste) */
        }
        #clearSearch:hover {
            background-color: #616161;
            transform: translateY(-3px);
            box-shadow: var(--shadow-medium);
        }

        #addConcursoButton {
            background-color: var(--primary-color);
        }
        #addConcursoButton:hover {
            background-color: #4A148C; /* Roxo mais escuro para o botão de adicionar */
            transform: translateY(-3px);
            box-shadow: var(--shadow-medium);
        }

        #addMessage {
            flex-basis: 100%;
            text-align: center;
            margin-top: 15px; /* Mais espaço acima */
            font-weight: 600;
            padding: 8px 0;
            border-radius: 5px;
            /* Cores dinâmicas para mensagem (verde para sucesso, vermelho para erro) */
        }

        .sorteio-card {
            background-color: var(--dark-bg);
            border: 1px solid #d2dce4; /* Borda mais clara */
            border-radius: var(--border-radius-sm);
            padding: 25px; /* Mais padding */
            margin-bottom: 20px;
            box-shadow: 0 4px 15px rgba(0, 0, 0, 0.08); /* Sombra mais forte */
            transition: transform 0.2s ease, box-shadow 0.2s ease;
        }

        .sorteio-card:hover {
            transform: translateY(-4px); /* Mais deslocamento no hover */
            box-shadow: var(--shadow-medium);
        }

        .sorteio-card h2 {
            margin-top: 0;
            color: var(--secondary-color); /* Título do card em roxo escuro */
            font-size: 1.4em;
            font-weight: 600;
            border-bottom: 1px solid #c2cbd4;
            padding-bottom: 12px;
            margin-bottom: 18px;
        }

        .dezenas {
            display: flex;
            flex-wrap: wrap;
            gap: 12px; /* Mais espaçamento entre as dezenas */
            justify-content: center;
        }

        .dezena {
            background-color: var(--primary-color); /* Bolas em roxo escuro */
            color: white;
            width: 55px; /* Define largura e altura iguais */
            height: 55px; /* Define largura e altura iguais */
            border-radius: 50%; /* Faz um círculo perfeito */
            font-weight: 700; /* Negrito para melhor visibilidade */
            font-size: 1.5em; /* Aumenta o tamanho da fonte */
            display: flex;
            justify-content: center;
            align-items: center;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.25); /* Sombra mais escura para destacar a bola */
            transition: background-color 0.2s ease, transform 0.2s ease, box-shadow 0.2s ease;
            border: 3px solid rgba(255, 255, 255, 0.5); /* Borda interna branca mais visível */
            text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.3); /* Sombra no texto para visibilidade */
        }

        .dezena:hover {
            background-color: #4A148C; /* Roxo mais escuro no hover */
            transform: scale(1.1);
            box-shadow: 0 6px 12px rgba(0, 0, 0, 0.35);
        }

        .no-results {
            text-align: center;
            color: #DC143C; /* Vermelho para erro (mantido) */
            font-weight: 700;
            margin-top: 40px;
            font-size: 1.2em;
            padding: 15px;
            background-color: #ffebee;
            border-radius: var(--border-radius-sm);
        }

        .navigation-link {
            text-align: center;
            margin-top: 30px;
            padding-top: 20px;
            border-top: 1px dashed var(--border-color);
        }

        .navigation-link p {
            margin: 0;
            font-size: 1.15em;
            color: var(--text-color);
        }

        .navigation-link a {
            color: var(--secondary-color); /* Links em roxo escuro */
            text-decoration: none;
            font-weight: 700;
            transition: color 0.2s ease, text-decoration 0.2s ease;
        }

        .navigation-link a:hover {
            color: var(--primary-color); /* Muda para o roxo principal no hover */
            text-decoration: underline;
        }

        /* MEDIA QUERIES para Responsividade */
        @media (max-width: 768px) {
            .container {
                padding: 20px;
            }

            h1 {
                font-size: 2.2em;
                margin-bottom: 30px;
            }

            .section-card {
                padding: 20px;
                margin-bottom: 25px;
            }

            .search-bar input[type="number"],
            .add-concurso-section input[type="text"] {
                min-width: unset;
                width: 100%;
                padding: 12px 15px;
            }

            .search-bar button, .add-concurso-section button {
                width: calc(50% - 7.5px); /* Ajustado para 2 botões por linha */
                font-size: 0.95em;
                padding: 12px 15px;
            }
            
            .search-bar button:nth-child(even), /* Aplica margin-top para quebras de linha */
            .add-concurso-section button:nth-child(even) {
                margin-top: 0;
            }

            .dezena {
                width: 50px; /* Ligeiramente menor em telas médias */
                height: 50px;
                font-size: 1.3em;
            }
        }

        @media (max-width: 480px) {
            body {
                padding: 10px;
            }

            .container {
                padding: 15px;
                border-radius: var(--border-radius-sm);
            }

            h1 {
                font-size: 1.8em;
                margin-bottom: 25px;
            }

            .section-card {
                padding: 15px;
                margin-bottom: 20px;
            }

            .search-bar, .add-concurso-section {
                gap: 10px; /* Reduz o espaçamento */
            }

            .search-bar button, .add-concurso-section button {
                width: 100%; /* Botões ocupam a largura total em telas muito pequenas */
                margin-top: 5px;
            }

            .dezena {
                width: 45px; /* Menor em telas pequenas */
                height: 45px;
                font-size: 1.1em;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <h1>Resultados dos Sorteios Quina</h1>

        <div class="section-card">
            <div class="search-bar">
                <label for="searchConcurso">Buscar Concurso:</label>
                <input type="number" id="searchConcurso" placeholder="Digite o número do concurso">
                <button id="searchButton">Buscar</button>
                <button id="clearSearch">Limpar</button>
            </div>
        </div>

        <div class="section-card">
            <div class="add-concurso-section">
                <label for="newDezenas">Adicionar Novo Concurso (dezenas separadas por vírgula):</label>
                <input type="text" id="newDezenas" placeholder="Ex: 01,02,03,04,05,06">
                <button id="addConcursoButton">Adicionar</button>
                <span id="addMessage"></span>
            </div>
        </div>

        <div id="results">
            <p style="text-align: center; color: var(--secondary-color); font-weight: 600;">
                Funcionalidades de busca e adição requerem JavaScript.
                Este é um exemplo de layout e estilo estático.
            </p>
        </div>
    </div>
</body>

            // --- FIM DOS SEUS DADOS RAW ---


            // Transforma os dados raw para o formato desejado, ordenando as dezenas
            function processRawData(rawData) {
                const processedData = [];
                for (let i = 1; i <= Object.keys(rawData).length; i++) {
                    const concursoKey = String(i);
                    const dezenasString = rawData[concursoKey];

                    if (dezenasString) {
                        const dezenasNumericas = dezenasString.map(Number).sort((a, b) => a - b);
                        processedData.push({
                            concurso: i,
                            dezenas: dezenasNumericas
                        });
                    }
                }
                return processedData;
            }

            let todosSorteios = processRawData(rawSorteiosData2);

            // Função para renderizar os sorteios
            function renderSorteios(sorteiosParaExibir) {
                resultsDiv.innerHTML = ''; // Limpa os resultados anteriores

                if (sorteiosParaExibir.length === 0) {
                    resultsDiv.innerHTML = '<p class="no-results">Nenhum sorteio encontrado para a sua busca.</p>';
                    return;
                }

                sorteiosParaExibir.forEach(sorteio => {
                    const sorteioCard = document.createElement('div');
                    sorteioCard.classList.add('sorteio-card');

                    const titulo = document.createElement('h2');
                    titulo.textContent = `Concurso: ${sorteio.concurso}`;
                    sorteioCard.appendChild(titulo);

                    const dezenasDiv = document.createElement('div');
                    dezenasDiv.classList.add('dezenas');
                    sorteio.dezenas.forEach(dezena => {
                        const dezenaSpan = document.createElement('span');
                        dezenaSpan.classList.add('dezena');
                        dezenaSpan.textContent = String(dezena).padStart(2, '0');
                        dezenasDiv.appendChild(dezenaSpan);
                    });
                    sorteioCard.appendChild(dezenasDiv);

                    resultsDiv.appendChild(sorteioCard);
                });
            }

            // Evento de clique para o botão de busca
            searchButton.addEventListener('click', () => {
                const searchTerm = parseInt(searchInput.value);

                if (isNaN(searchTerm) || searchTerm <= 0) {
                    alert('Por favor, digite um número de concurso válido.');
                    return;
                }

                // Buscar apenas o concurso exato
                const foundSorteio = todosSorteios.find(s => s.concurso === searchTerm);
                if (foundSorteio) {
                    renderSorteios([foundSorteio]); // Passa um array com o sorteio encontrado
                } else {
                    resultsDiv.innerHTML = '<p class="no-results">Concurso não encontrado.</p>';
                }
            });

            // Evento de clique para o botão de limpar busca
            clearSearchButton.addEventListener('click', () => {
                searchInput.value = '';
                renderSorteios(todosSorteios); // Exibe todos os sorteios novamente
            });

            // Evento de clique para o botão de adicionar novo concurso
            addConcursoButton.addEventListener('click', () => {
                const dezenasString = newDezenasInput.value.trim();
                if (!dezenasString) {
                    addMessageSpan.textContent = 'Por favor, insira as dezenas.';
                    addMessageSpan.style.color = 'red';
                    return;
                }

                const dezenasArray = dezenasString.split(',').map(d => d.trim());

                // Validação simples das dezenas (ex: 5 dezenas, entre 1 e 80)
                if (dezenasArray.length !== 5 || dezenasArray.some(d => isNaN(Number(d)) || Number(d) < 1 || Number(d) > 80)) {
                    addMessageSpan.textContent = 'Formato inválido. Insira 6 dezenas separadas por vírgula (1-60).';
                    addMessageSpan.style.color = 'red';
                    return;
                }

                const dezenasNumericas = dezenasArray.map(Number).sort((a, b) => a - b);

                const novoConcursoNumero = todosSorteios.length > 0 ? todosSorteios[todosSorteios.length - 1].concurso + 1 : 1;

                const novoSorteio = {
                    concurso: novoConcursoNumero,
                    dezenas: dezenasNumericas
                };

                todosSorteios.push(novoSorteio);
                newDezenasInput.value = ''; // Limpa o campo

                addMessageSpan.textContent = `Concurso ${novoConcursoNumero} adicionado com sucesso!`;
                addMessageSpan.style.color = 'purple';

                // Renderiza o novo sorteio ou todos, se preferir ver todos
                renderSorteios([novoSorteio]);
            });

            // Renderiza todos os sorteios ao carregar a página pela primeira vez
            renderSorteios(todosSorteios);
        });
    </script>
</body>
</html>
